export default {
  data: function data() {
    return {
      detailStep: 1,
      placeDetail: [],
      operates: ['买入', '卖出', '补仓', '止损'],
      show: true
    };
  },
  props: {
    id: {
      type: [String, Number],
      default: -1
    },
    sheet: {
      type: Boolean,
      default: false
    }
  },
  watch: {
    id: {
      handler: function handler(nV, oV) {
        if (nV !== -1) {
          this.openDrawer(nV);
        } else {
          this.placeDetail = [];
        }
      },
      immediate: true
    }
  },
  computed: {
    sheets: {
      get: function get() {
        return this.sheet;
      },
      set: function set(val) {
        this.$emit('changeSheet', val);
      }
    }
  },
  methods: {
    openDrawer: function openDrawer(id) {
      var _this = this;

      this.placeDetail = [];
      this.show = true;
      $ax.getAjaxData('/EasWebUser/getPlaceID', {
        id: id
      }, function (res) {
        if (res.code == 1) {
          var list = JSON.parse(JSON.stringify(res.data));
          list.forEach(function (item) {
            item.placeTime = _this.$moment(Number(item.placeTime)).format('YYYY-MM-DD HH:mm:ss');
          });
          _this.placeDetail = list;
          _this.detailStep = 1;
        } else {
          console.log('错误错误');
        }

        _this.show = false;
      }, {
        hasToken: true
      });
    }
  }
};
